import React from 'react';
import ActionList from './ActionList';
import ActionFilters from './ActionFilters';
import { Col } from 'react-bootstrap';

const ActionTracker = () => {


  return (
    <>
        <Row className="my-4">
            <Utilities />
        </Row>
        <Row>
            <Col xs={3} className="border-right border-dark">
                <ActionFilters />
            </Col>  
            <Col xs={9}>
                <ActionList />
            </Col>
        </Row> 
    </>
  );
}

export default ActionTracker;
